export const Tile = ({tile}) => {


  return (
    <div className="tile-container">
      
    



      {Object.values(tile).map((info,i)=>{

return <p key={i} className="tile">this is the contact: {info}</p>


 }



 )}
     




     

    </div>
  );
};



